import { createRouter, createWebHistory } from "vue-router";
import LogIn from "../views/LogIn.vue";
const SideBar = () =>
  import("/Users/chakdahahsackey/pavelonv0.01/src/components/SideBar.vue");
import Dashboard from "../views/Dashboard.vue";

const routes = [
  {
    path: "/",
    name: "login",
    component: LogIn,
  },
  {
    path: "/forgotpassword",
    name: "ForgotPassword",
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/ForgotPassword.vue"),
  },
  {
    path: "/newpassword",
    name: "NewPassword",
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/NewPassword.vue"),
  },
  {
    path: "/new",
    redirect: "/dashboard",
    name: "Home",
    component: SideBar,
    children: [
      {
        path: "/dashboard",
        name: "Dashboard",
        component: Dashboard,
      },
      {
        path: "/borrowers",
        name: "Borrowers",
        component: () =>
          import(/* webpackChunkName: "about" */ "../views/Borrowers.vue"),
      },
      {
        path: "/disburse",
        name: "Disburse",
        component: () =>
          import(/* webpackChunkName: "about" */ "../views/Disburse.vue"),
      },
    ],
  },

  {
    path: "/products",
    name: "Products",
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/Products.vue"),
  },
  {
    path: "/test",
    name: "Test",
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/test.vue"),
  },
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  LinkActiveClass: "active",
  routes,
});

export default router;
